(117, '646daa1eb494c', 'test123', '[language]MATCH English OR [language]MATCH spanish', '`language` = \'english\' or `language` = \'spanish\'', 'SELECT * FROM `tb_journal` WHERE `language` = \'english\' or `language` = \'spanish\'', NULL, '2023-05-24 07:09:34', '1092', NULL),
(118, '646daa2fd8cc9', 'test123', '[MeSH]CONTAINS Diabetes OR [MeSH]CONTAINS Cancer OR [MeSH]CONTAINS dementia', '`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'', 'SELECT * FROM `tb_journal` WHERE `mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'', NULL, '2023-05-24 07:09:51', '15', NULL),
(119, '646daa46b1226', 'test123', '[counts]>10 OR [counts]<2', '`counts`>10 or `counts`<2', 'SELECT * FROM `tb_journal` WHERE `counts`>10 or `counts`<2', NULL, '2023-05-24 07:10:14', '668', NULL),
(121, '646daa62d06e3', 'test123', '#1 OR #2', '(`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\')', 'SELECT * FROM `tb_journal` WHERE (`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\')', '646daa1eb494c,646daa2fd8cc9', '2023-05-24 07:10:42', '1094', NULL),
(122, '646daa70820e6', 'test123', '#3 AND #4', '(`counts`>10 or `counts`<2) AND ((`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'))', 'SELECT * FROM `tb_journal` WHERE (`counts`>10 or `counts`<2) AND ((`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'))', '646daa46b1226,646daa62d06e3', '2023-05-24 07:10:56', '345', NULL),
(123, '646daa81b335c', 'test123', '[Pubmed Start Year]>2000 NOT [Pubmed Start Year]=2005', '`pubmed_start_year`>2000  and not  `pubmed_start_year`=2005', 'SELECT * FROM `tb_journal` WHERE `pubmed_start_year`>2000  and not  `pubmed_start_year`=2005', NULL, '2023-05-24 07:11:13', '160', NULL),
(124, '646daf2723ac5', 'test123', '[Journal]CONTAINS paediatric OR [Journal]CONTAINS pediatric', '`journal` like  \'%paediatric%\' or `journal` like  \'%pediatric%\'', 'SELECT * FROM `tb_journal` WHERE `journal` like  \'%paediatric%\' or `journal` like  \'%pediatric%\'', NULL, '2023-05-24 07:31:03', '42', NULL),
(127, '646db0cf2c345', 'test123', '#5 NOT (#6 OR #7) ', '((`counts`>10 or `counts`<2) AND ((`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'))) and not (`pubmed_start_year`>2000  and not  `pubmed_start_year`=2005) and not (`journal` like  \'%paediatric%\' or `journal` like  \'%pediatric%\')', 'SELECT * FROM `tb_journal` WHERE ((`counts`>10 or `counts`<2) AND ((`language` = \'english\' or `language` = \'spanish\') OR (`mesh` like  \'%diabetes%\' or `mesh` like  \'%cancer%\' or `mesh` like  \'%dementia%\'))) and not (`pubmed_start_year`>2000  and not  `pubmed_start_year`=2005) and not (`journal` like  \'%paediatric%\' or `journal` like  \'%pediatric%\')', NULL, '2023-05-24 07:38:07', '295', NULL),
(128, '646dc930bb044', 'test123', ' [counts]<10 NOT [counts]<2', ' `counts`<10  and not  `counts`<2', 'SELECT * FROM `tb_journal` WHERE  `counts`<10  and not  `counts`<2', NULL, '2023-05-24 09:22:08', '1158', NULL);
